import Home from './components/Home';
import CargarPedido from './components/CargarPedido';
import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import {Route, Redirect} from 'react-router-dom';
import './App.css';

function App() {

  controller('AppController', ['$rootScope', function ($rootScope) {
    $rootScope.imagenesGuardadas = [];
    $rootScope.imagesList = [];
    $rootScope.loadIndex = 5;
  }])

  return (
      <BrowserRouter>
        <Redirect to="/qChurreria" />
        <Route exact path='/qChurreria' render={(props)=><Home {...props} state={props}/>}/>
        <Route exact path='/cargarPedido' component={()=><CargarPedido/>}/>
      </BrowserRouter>   
  );
}

export default App;
